import logo from "./images/spacelogo.png";
import react, { useEffect } from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="logo" alt="logo" />
        <p>Shiv Patel</p>
        <a href="https://Github.com/shivpvtel">Github</a>
      </header>
    </div>
  );
}

export default App;
